import React from "react";
import PlaneService from "../services/PlaneService";
import Alert from 'react-bootstrap/Alert';

class Test extends React.Component {

    constructor(props){
      super(props)
        this.state = {
          ddd:""
        }
      this.loadData = this.loadData.bind(this);
    }

    componentDidMount(){
      this.loadData();
//      setInterval(this.loadData, 10000);
    }

    async loadData() {
        try {
            PlaneService.getTest().then((response) => {
                this.setState({
                ddd: response.data
            })
        });
        } catch (e) {
            console.log(e);
        }
    }

    render(){
      return(
        <div>
          <h3 className="text-center"> Test </h3>

           <Alert variant="warning">
            <Alert.Heading>ALERT !</Alert.Heading>
            <p> Acabou de entrar na Península Ibérica o avião XPTO. </p>
            <hr />
            <p className="mb-0"> <b> Dados sobre o avião: </b></p>
            <p>Icao: xpto | Origin: xpto | Latitude: xpto | Longitude: xpto</p>            
          </Alert>


          {this.state.ddd}
        </div>
      )
    }
}

export default Test
